/**
 *````
 *
 * Name:             BinaryDeserialize
 *
 * Full name:        System`BinaryDeserialize
 *
 *                   BinaryDeserialize[ByteArray[…]] recovers an expression from a binary representation generated by BinarySerialize.
 * Usage:            BinaryDeserialize[ByteArray[…], h] wraps h around the expression produced before returning it.
 *
 * Options:          None
 *
 * Attributes:       Protected
 *
 *                   local: paclet:ref/BinaryDeserialize
 * Documentation:    web: http://reference.wolfram.com/language/ref/BinaryDeserialize.html
 *
 * Definitions:      None
 *
 * Own values:       None
 *
 * Down values:      None
 *
 * Up values:        None
 *
 * Sub values:       None
 *
 * Default value:    None
 *
 * Numeric values:   None
 */
fun binaryDeserialize(vararg arguments: Any?, options: MutableMap<String, Any?> = mutableMapOf()): MathematicaFunction {
	return MathematicaFunction("BinaryDeserialize", arguments.toMutableList(), options)
}
